import React from 'react'

export default function Profile(props) {
    return (
<div className="Pro">
      <button onClick={props.handleName}>
        dfsdf
      </button>

        {props.children }




        <div>

        <h1>{props.fullName}</h1>
        <p>{props.bio}</p>
        <h2>{props.profession}</h2>

        </div>

        )}

</div>
  )
}
Profile.defaultProps={fullName:"youssef"}
